import React, { Component } from 'react';

import { lessons } from 'assets/data/mockup_lessons';

class Education extends Component {
    constructor(props) {
        super(props);
        this.state = { 
            sampleData: lessons
         }
    }

    displayVideoList() {
        let videoLists = [];
        this.state.videoArraySample.map((sampleData, index) => {
            videoLists.push(
                <Col xs={6} key={index} id={sampleData.id}>
                    <div className={style.videoContainer}>
                        <sampleData width="240" height="150" poster={sampleData.poster} controls preload="none" style={{ float: 'left' }}>
                            <source src={sampleData.path} type="sampleData/mp4"></source>
                        </sampleData>

                    </div>
                </Col>
            );
        })
        return videoLists;
    }

    render() { 
        return (<div>

        </div>);
    }
}
 
export default Education;
